import React, { useEffect, useState } from "react";
import { getJournals, deleteJournal } from "../services/journalService";
import AddJournalForm from "./AddJournalForm";

const JournalList = () => {
  const [journals, setJournals] = useState([]);

  const fetchJournals = async () => {
    const res = await getJournals();
    setJournals(res.data);
  };

  useEffect(() => {
    fetchJournals();
  }, []);

  const handleDelete = async (id) => {
    await deleteJournal(id);
    fetchJournals();
  };

  return (
    <div>
      <AddJournalForm onJournalAdded={fetchJournals} />
      {journals.map((j) => (
        <div key={j._id} style={{ border: "1px solid #ccc", margin: "10px", padding: "10px" }}>
          <p><b>Mood:</b> {j.mood}</p>
          <p><b>Stress Level:</b> {j.stressLevel}</p>
          <p><b>Note:</b> {j.note}</p>
          <button onClick={() => handleDelete(j._id)}>Delete</button>
        </div>
      ))}
    </div>
  );
};

export default JournalList;
